import React from "react";
import icon from "./icon.jpeg";
import "./nav.css";

const Nav = () => {
  return (
    <nav className="header">
      {/* logo on the left */}
      {/* links to different pages */}
      {/* A search box */}
      {/* profile wishlist and bag on the right */}

      <img className="header__logo" src={icon} alt="Myntra_logo" />
      <a href="#">Men</a>
      <a href="#">Women</a>
      <a href="#">Kids</a>
      <a href="#">Men</a>
      <a href="#">Men</a>
      <a href="#">Men</a>
    </nav>
  );
};

export default Nav;
